import React from 'react';
import backgroundImage from '../images/Trading.png';

function Trading() {
  return (
    <section
      className="relative bg-center bg-no-repeat bg-cover h-[93vh]"
      style={{ backgroundImage: `url(${backgroundImage})` }}
    >
      <div className="absolute inset-0 bg-black opacity-50"></div>
      <div className="relative px-4 mx-auto max-w-screen-xl h-full flex items-center">
        <div className="max-w-2xl">
          <h3 className="text-yellow-400 text-2xl font-mono font-extrabold uppercase">
            - Trading
          </h3>
          <h1 className="mb-4 text-4xl font-bold leading-none tracking-tight md:text-5xl lg:text-6xl text-white mt-12">
            Get back to{' '}
            <span className="decoration-solid underline underline-offset-[11px] decoration-red-600 font-normal">
              growth{' '}
            </span>
            with our{' '}
            <span className="text-yellow-400 font-normal">#1 Trading</span>{' '}
            services.
          </h1>
          <p className="text-lg font-normal lg:text-xl text-gray-200 mt-8 p-6 bg-gray-800 bg-opacity-80 rounded-xl shadow-lg transition duration-300 ease-in-out hover:bg-gray-700">
            Our mission is to provide high-quality and cost-effective solutions
            for the transportation of goods and oil products across the Black
            and Caspian seas. We aim to deliver value to our customers, partners,
            and employees through our professionalism, integrity, and innovation.
          </p>
        </div>
      </div>
    </section>
  );
}

export default Trading;
